import React, { useState, useEffect } from 'react';
import CarForm from './components/CarForm';
import CarTable from './components/CarTable';
import axios from 'axios';
import './App.css';

axios.defaults.baseURL = "http://localhost:8081";

function App() {
  const [cars, setCars] = useState([]);
  const [pendingCars, setPendingCars] = useState([]);

  useEffect(() => {
    // Fetch all cars from the backend
    axios.get('/api/cars')
      .then(response => {
        setCars(response.data);
      })
      .catch(error => console.error('There was an error!', error));
  }, []);

  const handleAddCar = (car) => {
    setPendingCars([...pendingCars, car]);
  };

  const handleRegisterCar = (car) => {
    axios.post('/api/cars/register', car)
      .then(response => {
        setCars([...cars, response.data]);
        setPendingCars(pendingCars.filter(pendingCar => {
          pendingCar.name !== car.name &&
          pendingCar.model !== car.model
        }
        ));
      })
      .catch(error => console.error('There was an error!', error));
  };

  const handleDeletePendingCar = (car) => {
    setPendingCars(pendingCars.filter(pendingCar => pendingCar !== car));
  };

  return (
    <div className="App">
      <h1>Car Registration</h1>
      <CarForm onAddCar={handleAddCar} />
      <CarTable
        cars={cars}
        pendingCars={pendingCars}
        onRegister={handleRegisterCar}
        onDelete={handleDeletePendingCar}
      />
    </div>
  );
}

export default App;
